import React from 'react';
import Typography from '@material-ui/core/Typography';



class Skills extends React.Component {
  constructor(props){
    super(props);
  }

  render(){
    return(
      <div >
        <Typography variant="h2" gutterBottom>
          Skills
        </Typography>
      </div>
    );
  }
}

export default Skills;
